import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Url
import { getAllAssistants } from '../../../settings';

// Styles
import { MyBody, MyButton, UserTable } from './Assistant.styles';

const AssistantEndpoint = () => {
  const [assistants, setassistants] = useState([{}]);

  const fetchAssistants = async (URL) => {
    const response = await fetch(URL, {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
      },
    });
    const myAssistants = await response.json();

    setassistants(
      myAssistants.map((assistants) => {
        return assistants;
      })
    );
  };
  useEffect(() => {
    fetchAssistants(getAllAssistants);
  }, []);

  return (
    <MyBody>
      <UserTable>
      </UserTable>
    </MyBody>
  );
};

export default AssistantEndpoint;
